// src/components/CandidatosTable.js
import React, { useState, useEffect } from 'react';
import { Table, Button } from 'react-bootstrap';
import axios from 'axios';

const CandidatosTable = ({ candidatos }) => {
  const [message, setMessage] = useState('');

  const handleDelete = async (cpf) => {
    try {
      await axios.delete(`http://localhost:4000/api/candidatos/${cpf}`);
      setMessage('Candidato deletado com sucesso!');
    } catch (error) {
      console.error('Erro ao deletar candidato:', error.message);
      setMessage('Erro ao deletar candidato. Por favor, tente novamente.');
    }
  };

  return (
    <div>
      {message && <div className="alert alert-success">{message}</div>}
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>CPF</th>
            <th>Nome</th>
            <th>Endereço</th>
            <th>Telefone</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {candidatos.map((candidato) => (
            <tr key={candidato.cand_cpf}>
              <td>{candidato.cand_cpf}</td>
              <td>{candidato.cand_nome}</td>
              <td>{candidato.cand_endereco}</td>
              <td>{candidato.cand_telefone}</td>
              <td>
                <Button variant="danger" onClick={() => handleDelete(candidato.cand_cpf)}>Excluir</Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default CandidatosTable;
